import React from 'react'
import './M'
const MakeAComment = () => {
  return (
    <div>
        <div className='navbar'>
          <ul>
            <li>HOME</li>
            <li>ABOUT</li>
            <li>DEVELOPER</li>
          </ul>
        </div>
    </div>
  );
}

export default MakeAComment;
